import React from 'react';

import PageHeader from '../../components/PageHeader';
import HomeItem from '../../components/HomeItem';

import './styles.css';

function Home() {
  return (
    <div id="page-home" className="container">
       <PageHeader />
       <main>
         <HomeItem 
         title="Começamos assim..."
         description=""
         />
         <HomeItem title="O que é TEA?"/>
       </main>
    </div>    
  )
}

export default Home;
